tables.table_schema:
CREATE TABLE hedge_funds (
    fund_id INT,
    fund_name VARCHAR(50),
    total_assets DECIMAL(18,2)
);

CREATE TABLE HedgeFundInvestors (
    investor_id INT PRIMARY KEY,
    investor_name VARCHAR(255),
    investment_amount DECIMAL(10, 2)
);

CREATE TABLE HedgeFundHoldings (
    holding_id INT PRIMARY KEY,
    holding_name VARCHAR(255),
    shares_held INT,
    market_value DECIMAL(10, 2)
);

CREATE TABLE HedgeFundManagers (
    manager_id INT PRIMARY KEY,
    manager_name VARCHAR(255),
    experience_years INT,
    performance_rating DECIMAL(3, 2)
);
